function Tile({className , value , onClick , PlayerTurn}) {
    let hoverClass=null;
    if(hoverClass==null && PlayerTurn!=null){
        hoverClass=`${PlayerTurn}-hover`;
    }
    return ( <div onClick={onClick} className={`tile ${className} ${hoverClass}`}>
        {value}
    </div> );
}

export default Tile;
